☆お得な2個セット☆<br><br>
パソコンデスク脇やキッチンカウンターの下、押入れの中など、様々な場所で使用していただける収納カートです。<br>
シックで上品な2色からお選びいただけます。<br>
キャスターが5つ付いているので、安定感があり頑丈です。<br><br><br>●商品サイズ（cm）<br>
外寸：幅約75×奥行約26×高さ約65（取っ手を除く）<br>
内寸：幅約35.1×奥行約23.9×高さ約57（可動棚ピッチ32mm）<br>
●重量：約11.6kg<br>
●側板の穴数：15個<br>
●耐荷重<br>
天板：約8kg<br>
底板各：約10kg<br>
棚板：1枚あたり約10kg<br>
全体：約48kg<br>
●材質：プリント紙化粧パーティクルボード<br>
●カラー：ナチュラル、ブラウン<br><style type="text/css">

